import React from "react";
import banner from "../asset/Screenshot.png";
const HeroPage = () => {
  return (
    <div className="py-14">
      <img
        src={banner}
        alt="Example"
        className="w-fit max-h-[600px] w-screen "
      />
    </div>
  );
};

export default HeroPage;
